import React from 'react'

const StageFour = ({ stageFour }) => {
  return (
    <div>
        <h1>Quarta tela do game</h1>
        <div className="button">
          <button className='button-87' onClick={stageFour}> Verificar </button>
        </div>
    </div>
  )
}

export default StageFour;
